
const ApiError = require('../functions/ApiError');
const { ResponceAPI } = require("../utils/ResponceAPI");


const version = process.env.API_VERSION

//upload symptoms images
const creteOrderInvoice = async (req, res) => {
  try {
    const { invoiceType, orderId } = req.body;
    const base64="data:application/pdf;base64,"

    if(invoiceType=="pathology"){
        return res.status(201).send(ResponceAPI(true, "pathology invoice Successfully ", {pdf:base64}, null, null, version))
    }else if(invoiceType=="product"){
        return res.status(201).send(ResponceAPI(true, "product invoice Successfully ", {pdf:base64}, null, null, version))
    }else{
        return res.status(201).send(ResponceAPI(false, null, null, 400, "invalid invoice Type", version))
    }
  } catch (error) {
    ApiError(error, "invoice create");
    return res.status(500).send(ResponceAPI(false, null, error.message, 500, "server error", version))
  }
};

